Good shooting .223 bolt action hunting rifle. With good ammo (and a more powerful scope, I have bad eyes)I can hit a 3 shot 1 inch group @ 175 yards with 65 and 79  grain ballistic, with 55 I am hitting 1.5 -1.75inches 3 shot groups.

@100 yards I can hit 5 shot groups in .5" with 52-55 grain.

I will sell gun alone for $270.00 cash,,,it is like new.
